import React, { Component } from "react";
import { FaBeer } from 'react-icons/fa';

class Home extends Component {
  state = {};

  render() {
    return (
      <div style={styles.mainStyle}>
        <div style={styles.boxStyle} > 
           <FaBeer size='2em'/>
        </div>
      </div>
    );
  }
}

const styles = {
  mainStyle: {
    display: "flex",
    alignItems: 'center',
    margin: "1.6%",
    marginLeft: '15%',
    marginRight: '15%',
    //backgroundColor: 'grey',
    flexDirection: 'column'
  },
  boxStyle: {
    display: 'flex',
    //alignItems: 'center',
    flexDirection: 'column',
    height: 80,
    borderRadius: 6,
    justifyContent: 'space-between',
    boxShadow: "1px 4px 8px 1px #9E9E9E",
    //border: "1px solid black",
    width: '100%',
  }
};

export default Home;
